// International US KB:
// -------------------
//
//  Keyboard AltGr summary:  
//
//  LC          `1234567890-=   qwertyuiop[]\   asdfghjkl;'   zxcvbnm,./
//  UC          ~!@#$%^&*()_+   QWERTYUIOP{}|   ASDFGHJKL:"   ZXCVBNM<>?  
//  LC+AltGr     ¡²³¤€¼½¾‘’¥×   äåé®þüúíóö«»¬   áßð     ø¶´   æ ©  ñµç ¿
//  UC+AltGr     ¹  £       ÷   ÄÅÉ ÞÜÚÍÓ   ¦   Á§Ð     Ø°¨   Æ    Ñ Ç 
//
//
//  
//  International US KB setup:
//
//
//
//
//  Hex KB input methods:
//  --------------------
//
//  + is NumPad + key
//  n is NumPad 0-9 key 
//  X is either NumPad 0-9 key -or- regular A-F key  (hex digit)
//
//
//
//  Alt and nnnn    =     code page 437 values  (can use modulo-256)
//  Alt and 0nnnn   =     code page 1252 values  (can use modulo-256)
//  Alt and +XXXX   =     Unicode values  -- requires EnableHexInputMethod addition in registry
//
//
//  Enable  Hex InputMethod -or- EnableHexNumpad
//
//  1) Regedit -- HKEY_CURRENT_USER\Control Panel\Input Method:   Add in string value -    EnableHexNumpad     REG_SZ       1
//
//
//
//
//
//  Unicode Output on Console
//  -------------------------
//
//  1) Regedit -- HKEY_LOCAL_MACHINE\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Console\TrueTypeFont: Add in string value =    000 (etc.)     REG_SZ      DejaVue Sans Mono
//
//  2) chcp 65001
//
//  3) On console window, Set defaults and properties -- Font to DejaVu Sans Mono -- may need to alter size, too for setting to take   
//
//
//
//
//   Windows Character Map:
//   ----------------------
//
//   Start -> All Programs -> Accessories -> System Tools -> Character Map
//
//
//
//   Private Character (E000-F8FF) Editor:
//   ------------------------
//
//   cmd line : eudcedit
//
//
//
